import { Button } from "devextreme-react";
import React, { Fragment } from "react";
import { SUPTable, SUPContainer, SUPRow1Col2 } from "./pageStyles";

const UniversityPage = () => {
  const openNewTab = (url) => {
    window.open(url, "_blank", "noreferrer");
  };

  return (
    <SUPContainer>
      <SUPTable>
        <tr>
          <th style={{ width: "500px", border: "1px solid black" }}>Geral</th>
          <th style={{ width: "500px", border: "1px solid black" }}>Outros</th>
        </tr>
        <tr>
          <td>1</td>
          <td>2</td>
        </tr>
        <tr>
          <td>3</td>
          <td>4</td>
        </tr>
        <tr>
          <td>5</td>
          <td>6</td>
        </tr>
      </SUPTable>
      <br />
      <br />
      <SUPTable>
        <tr>
          <th
            style={{
              width: "500px",
              height: "100px",
              border: "1px solid black",
            }}
          >
            Disciplinas
          </th>
          <td>1</td>
          <td>1</td>
          <td>1</td>
          <td>1</td>
        </tr>
        <tr>
          <th
            style={{
              width: "500px",
              height: "100px",
              border: "1px solid black",
            }}
          >
            Relacionados
          </th>
          <td>2</td>
          <td>2</td>
          <td>2</td>
          <td>2</td>
        </tr>
      </SUPTable>
    </SUPContainer>
  );
};

export default UniversityPage;
